import React from "react";
//import CardBtn from "../CardBtn";
import "./style.css";
import storeSchema from "../models/Books.js"

function Card(props) {
  return (
    <div
      className="card"
      style={{
        backgroundImage: props.photo ? `url(${props.photo})` : "none"
      }}
    >
      {!props.image && <i className="fa fa-spinner fa-spin" aria-hidden="true" />}
     
    </div>
  );
}

export default Card;
